import React from 'react';

function EventCards() {
    const events = [
        {
            title: "QUARCC wins $10,000 at McGill-FIAM Hackathon",
            description: "Our team QUARCC won first place at the McGill-FIAM Hackathon...",
            date: "2024-11-10T23:30:00.000Z",
            image: "/path-to-image.jpg",
            link: "/events/quarcc-wins"
        },
        // Add more events here...
    ];

    return (
        <div className="overflow-hidden">
            <div className="flex -ml-1 relative [transform:translate3d(0px,0px,0px)]">
                {events.map((event, index) => (
                    <div key={index} className="pl-1 grow-0 min-w-0 relative shrink-0 basis-9/12 md:basis-6/12 lg:basis-[33.3333%]">
                        <a className="w-fit h-fit text-[oklch(14.479%_0_none)] [text-decoration:none_solid_oklch(14.479%_0_none)]" href={event.link}>
                            <div className="p-1">
                                <div className="text-[oklch(14.479%_0_none)] [background-color:oklch(100%_0_none)]" style={{borderRadius: "0.75rem", borderWidth: "1px"}}>
                                    <img 
                                        alt={event.title}
                                        width="500"
                                        height="500"
                                        decoding="async"
                                        className="block h-full w-full max-w-full text-[oklch(0%_0_none_/_0)] align-middle object-cover aspect-square"
                                        style={{borderTopLeftRadius: "0.75rem", borderTopRightRadius: "0.75rem"}}
                                        src={event.image}
                                    />
                                    <div className="p-6 flex flex-col">
                                        <h3 className="m-0 text-[16px] leading-snug font-semibold -tracking-wide overflow-hidden [display:-webkit-box] [-webkit-line-clamp:2] [-webkit-box-orient:vertical]">
                                            {event.title}
                                        </h3>
                                        <p className="m-0 text-sm mt-[6px] leading-5 text-[oklch(55.553%_0_none)] overflow-hidden [display:-webkit-box] [-webkit-line-clamp:2] [-webkit-box-orient:vertical]">
                                            {event.description}
                                        </p>
                                    </div>
                                    <div className="p-6 flex pt-0 flex-col items-start sm:flex-row justify-between sm:items-center">
                                        <div className="flex gap-x-2 text-sm leading-5 items-start text-[oklch(55.553%_0_none)] sm:items-center">
                                            <CalendarIcon />
                                            <time dateTime={event.date} className="text-xs leading-4 lg:text-base lg:leading-6 [text-wrap:nowrap]">
                                                {new Date(event.date).toLocaleDateString('en-US', {
                                                    month: 'long',
                                                    day: 'numeric',
                                                    year: 'numeric'
                                                })}
                                            </time>
                                        </div>
                                        <a href={event.link} className="text-[oklch(14.479%_0_none)] [text-decoration:none_solid_oklch(14.479%_0_none)]">
                                            <button className="h-9 m-0 p-0 py-2 w-fit text-sm leading-5 font-medium text-[oklch(44.889%_0.15545_-73.341)] normal-case inline-flex ease-in-out items-center cursor-pointer justify-center duration-[0.15s] tracking-[normal] whitespace-nowrap transition-colors underline-offset-4 [appearance:button] [background-color:oklch(0%_0_none_/_0)] [background-image:none]" style={{borderRadius: "6px"}}>
                                                <span>Learn more...</span>
                                                <ArrowIcon />
                                                <span className="p-0 w-px h-px -m-px absolute overflow-hidden whitespace-nowrap [clip:rect(0px,0px,0px,0px)]" style={{borderWidth: "0px"}}>
                                                    Learn more about {event.title}
                                                </span>
                                            </button>
                                        </a>
                                    </div>
                                </div>
                            </div>
                        </a>
                    </div>
                ))}
            </div>
        </div>
    );
}

function CalendarIcon() {
    return (
        <svg width="15" height="15" viewBox="0 0 15 15" fill="none" xmlns="http://www.w3.org/2000/svg" className="w-4 h-4 block align-middle">
            <path d="M4.5 1C4.77614 1 5 1.22386 5 1.5V2H10V1.5C10 1.22386 10.2239 1 10.5 1C10.7761 1 11 1.22386 11 1.5V2H12.5C13.3284 2 14 2.67157 14 3.5V12.5C14 13.3284 13.3284 14 12.5 14H2.5C1.67157 14 1 13.3284 1 12.5V3.5C1 2.67157 1.67157 2 2.5 2H4V1.5C4 1.22386 4.22386 1 4.5 1ZM10 3V3.5C10 3.77614 10.2239 4 10.5 4C10.7761 4 11 3.77614 11 3.5V3H12.5C12.7761 3 13 3.22386 13 3.5V5H2V3.5C2 3.22386 2.22386 3 2.5 3H4V3.5C4 3.77614 4.22386 4 4.5 4C4.77614 4 5 3.77614 5 3.5V3H10ZM2 6V12.5C2 12.7761 2.22386 13 2.5 13H12.5C12.7761 13 13 12.7761 13 12.5V6H2Z" fill="currentColor" fillRule="evenodd" clipRule="evenodd"/>
        </svg>
    );
}

function ArrowIcon() {
    return (
        <svg width="15" height="15" viewBox="0 0 15 15" fill="none" xmlns="http://www.w3.org/2000/svg" className="w-4 h-4 block ml-1.5 ease-in-out align-middle duration-[0.15s] transition-transform">
            <path d="M8.14645 3.14645C8.34171 2.95118 8.65829 2.95118 8.85355 3.14645L12.8536 7.14645C13.0488 7.34171 13.0488 7.65829 12.8536 7.85355L8.85355 11.8536C8.65829 12.0488 8.34171 12.0488 8.14645 11.8536C7.95118 11.6583 7.95118 11.3417 8.14645 11.1464L11.2929 8H2.5C2.22386 8 2 7.77614 2 7.5C2 7.22386 2.22386 7 2.5 7H11.2929L8.14645 3.85355C7.95118 3.65829 7.95118 3.34171 8.14645 3.14645Z" fill="currentColor" fillRule="evenodd" clipRule="evenodd"/>
        </svg>
    );
}

export default EventCards;
